      console.log("runnig ");

        if(items!=undefined){

            let sloads=[];
            let tloads=[];

            if(load!=undefined){
          await load.map((el)=>{
            var count = Object.keys(el).length;

            if(count==0)
            {
              console.log("zero");
              return(<></>)
            }else{
              
              console.log("el  : ",el.data.load_type);

                if(el.data.load_type=='Solo'){
                sloads.push(el);
                }else{
